import React from 'react';

const Slide4 = () => {
  console.log('Rendering Slide4');
  return (
    <div style={styles.container}>
      <img src="/images/File4.svg" alt="Slide 4" style={styles.image} />
    </div>
  );
};

const styles = {
  container: {
    textAlign: 'center',
    height: '100vh',
    backgroundColor: '#9fd3c7',
    display: 'flex',
    justifyContent: 'center',
    alignItems: 'center',
    overflow: 'hidden',
    position: 'relative'
  },
  image: {
    width: '30%',
    height: '30%',
    objectFit: 'cover'
  }
};

export default Slide4;
